package com.bytefinger.toutuo.biz.oa.domain;import com.baomidou.mybatisplus.annotation.FieldFill;import com.baomidou.mybatisplus.annotation.TableField;import com.baomidou.mybatisplus.annotation.TableName;import com.bytefinger.common.core.domain.BaseEntity;import com.bytefinger.common.security.annotation.Excel;import com.bytefinger.toutuo.common.annotation.HistoryFieldLog;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;import lombok.Data;import lombok.experimental.Accessors;import java.util.Date;/** * <p> * 发起OA审批 * </p> * * @author Jone * @since 2023-02-22 */@Data@Accessors(chain = true)@TableName("biz_oa_approval_log")@ApiModel(value = "OaApprovalLog对象", description = "发起OA审批")public class OaApprovalLog extends BaseEntity {    /**     * 审批编号     */    @ApiModelProperty(value = "审批编号", hidden = false, required = false)    @TableField("approval_no")    @HistoryFieldLog("审批编号")    @Excel(name = "审批编号")    private String approvalNo;    /**     * 审批日志内容     */    @ApiModelProperty(value = "审批日志内容", hidden = false, required = false)    @TableField("content")    @HistoryFieldLog("审批日志内容")    @Excel(name = "审批日志内容")    private String content;    /**     * 创建时间     */    @ApiModelProperty(value = "创建时间", hidden = false, required = false)    @TableField(value = "create_time", fill = FieldFill.INSERT)    @HistoryFieldLog("创建时间")    @Excel(name = "创建时间")    private Date createTime;    /**     * 审批时间     */    @ApiModelProperty(value = "审批时间", hidden = false, required = false)    @TableField("approval_time")    @HistoryFieldLog("审批时间")    @Excel(name = "审批时间")    private Date approvalTime;}